nacionalidadTxt":null,"nombreMadreElla":null,"nombrePadreElla":null,"notasMarginales":"DE ACUERDO CON LA SENTENCIA DICTADA  EL 21 DE AGOSTO DEL 2007,  POR EL CIUDADANO JUEZ  NOVENO CIVIL DE ESTE DE PARTIDO ESPECIACIALIZADO EN MATERIA FAMILIAR, EN EL JUICIO ORAL DE DIVORCIO NECESARIO, EXPEDIENTE  NUMERO  C-150/2007, EL CUAL  CAUSO EJECUTORIA EL 26 DE AGOSTO DEL 2016, SOBRE DIVORCIO  PROMOVIDO POR MARIBEL BARAJAS RIVERA EN CONTRA DE VÍCTOR EDUARDO MARTÍNEZ FONSECA CON FORME A EL ARTÍCULO 354 DEL CODÍGO DE PROCEDIMIENTOS CIVILES VIGENTE EN EL ESTADO, PARA EL EFECTO DE QUE SE DISUELVA EL VÍNCULO MATRIMONIAL EXISTENTE ENTRE AMBOS, BAJO LOS SIGUIENTES PUNTOS RESOLUTIVOS:\r\n\r\nPRIMERO.- ESTE JUZGADO RESULTO COMPETENTE PARA CONOCER DEL PRESENTE JUICIO Y LA VIA ABORDADA POR LAS PARTES RESULTO SER LA IDONEA. SEGUNDO.- LA C. MARIBEL BARAJAS RIVERA, PROBO SU ACCION INTENTADA Y LA DEMANDADA SE ALLANO A LA DEMANDA ENTABLADA EN SU CONTRA. EN CONSECUENCIA SE DECRETA LA DISOLUCION DEL VINCULO MATRIMONIAL HABIDO ENTRE LAS PARTES, POR LO QUE UNA VEZ QUE CAUSE EJECUTORIA LA PRESENTE RESOLUCION SE ORDENA REMITIR COPIA CERTIFICADA DE LA MISMA AL C. OFICIAL DEL REGISTRO CIVIL CORRESPONDIENTE, PARA QUE SE SIRVA LEVANTAR EL ACTA DE DIVORCIO RESPECTIVA Y PARA TAL EFECTO REMITASE EXHORTO CON LOS INSERTOS NECESARIOS AL C. JUEZ DE IGUAL CATEGORIA DE GUANAJUATO, CAPITAL, PARA QUE EN AUXILIO LAS LABORES DE ESTE JUZGADO SE HAGA LLEGAR A DICHA OFICIALIA. NOTIFIQUESE PERSONALMENTE A LA PARTE ACTORA Y POR LISTA AL DEMANDADO POR HABER SEÑALADO LOS ESTRADOS DE ESTE JUZGADO PARA TAL EFECTO. DESE SALIDA AL EXPEDIENTE EN LOS LIBROS DE GOBIERNO RESPECTIVOS Y EN SU OPORTUNIDAD ARCHIVESE COMO ASUNTO TOTALMENTE CONCLUIDO. ASI, LO RESOLVIO Y FIRMO EL C. ANTONIO GARCIA CERVANTES, JUEZ NOVENO CIVIL DE ESTE PARTIDO JUDICIAL, QUE ACTUA CON SECRETARIO. DOY FE.\r\n\r\nSE HACE LA PRESENTE  ANOTACIÓN  CON  FUNDAMENTO  EN EL ARTICULO 117 DEL CÓDIGO  CIVIL VIGENTE  EN EL ESTADO .-  GUANAJUATO , GTO A 5 DE  OCTUBRE DEL 2016.-OFICIAL COMISIONADA DEL REGISTRO CIVIL.- LIC. AGUSTINA HERNANDEZ ZAMARRIPA.- DOY  FE.- ","oficialiaNombre":null,"segundoApellido":null,"MAT_EDAD_DEL_CTY":null,"MAT_ERROR_ORIGEN":null,"MAT_NOM_DELA_CTY":"MARIBEL","MAT_SEXO_DEL_CTY":"M","MAT_TIPO_PERSONA":null,"anioRegMadreElla":0,"anioRegPadreElla":0,"localidadMadreEl":null,"localidadPadreEl":null,"matArchivoOrigen":null,"matDocExtranjero":null,"nacionalidadAux1":0,"nacionalidadAux2":0,"nacionalidadElla":0,"ofiCodigoRegElla":0,"primerApellidoEl":"MARTINEZ","MAT_EDAD_DELA_CTY":null,"MAT_SEXO_DELA_CTY":"F","actaBisRegMadreEl":null,"actaBisRegPadreEl":null,"actaNumeroRegElla":0,"entidadCodigoElla":0,"fechaModificacion":null,"fechaNacimientoEl":null,"fechaRegistroDate":"02/03/2002","municipioCodigoEl":0,"nacionalidadElTxt":"MEXICANA","segundoApellidoEl":"FONSECA","MAT_ARCHIVO_ORIGEN":null,"MAT_DOC_EXTRANJERO":null,"MAT_NOM_MA_DEL_CTY":"MA ELENA","MAT_NOM_PA_DEL_CTY":"JOSE DE JESUS","entidadCodigoRegEl":0,"estadoRegNacNombre":null,"localidadMadreElla":null,"localidadPadreElla":null,"municipioNacNombre":null,"municipioRegNombre":"GUANAJUATO","primerApellidoElla":"BARAJAS","ENT_COD_NAC_DEL_CTY":null,"MAT_EDAD_MA_DEL_CTY":null,"MAT_EDAD_PA_DEL_CTY":null,"MAT_LOC_NAC_DEL_CTY":"LEON","MAT_NOM_MA_DELA_CTY":"MA SOCORRO","MAT_NOM_PA_DELA_CTY":"JOSE","MAT_SEXO_MA_DEL_CTY":"F","MAT_SEXO_PA_DEL_CTY":"M","MUN_COD_NAC_DEL_CTY":null,"actaBisRegMadreElla":null,"actaBisRegPadreElla":null,"fechaNacimientoElla":null,"imaNombreHomologado":null,"municipioCodigoElla":0,"nacionalidadAux1Txt":null,"nacionalidadAux2Txt":null,"nacionalidadEllaTxt":"MEXICANA","nacionalidadMadreEl":0,"nacionalidadPadreEl":0,"ofiCodigoRegMadreEl":0,"ofiCodigoRegPadreEl":0,"segundoApellidoElla":"RIVERA","ENT_COD_NAC_DELA_CTY":null,"MAT_EDAD_MA_DELA_CTY":null,"MAT_EDAD_PA_DELA_CTY":null,"MAT_LOC_NAC_DELA_CTY":"LEON","MAT_SEXO_MA_DELA_CTY":"F","MAT_SEXO_PA_DELA_CTY":"M","MUN_COD_NAC_DELA_CTY":null,"NAC_ANIO_REG_DEL_CTY":null,"actaNumeroRegMadreEl":0,"actaNumeroR