l,"nacionalidadTxt":null,"nombreMadreElla":null,"nombrePadreElla":null,"notasMarginales":"DE ACUERDO CON LA SENTENCIA DICTADA EL 26 DE FEBRERO DE 2018 POR LA CIUDADANA JUEZ DE PARTIDO CIVIL ESPECIALIZADA EN MATERIA FAMILIAR DEL PARTIDO JUDICIAL DE GUANAJUATO, GUANAJUATO, QUE CAUSA EJECUTORIA POR MINISTERIO DE LEY, DENTRO DEL EXPEDIENTE F1128/2017 CON MOTIVO DEL CAMBIO DE VÍA ADOPTADO EN LA AUDIENCIA PRELIMINAR CELEBRADA DENTRO DEL PROCESO ORAL ORDINARIO SOBRE DISOLUCIÓN DEL VÍNCULO MATRIMONIAL Y OTRAS PRESTACIONES, PROMOVIDO POR ALMA FABIOLA FLORES CASTILLO EN CONTRA DE MARCO AURELIO SERAFÍN MUÑOZ,  PARA EL EFECTO DE QUE SE DISUELVA EL VÍNCULO MATRIMONIAL EXISTENTE ENTRE AMBOS, BAJO LOS SIGUIENTES PUNTOS RESOLUTIVOS:  PRIMERO. ESTA JUZGADORA FUE COMPETENTE PARA CONOCER Y RESOLVER LA SOLICITUD DEL CAMBIO DE VÍA DE LA ORAL ORDINARIA A LA VÍA ORAL ESPECIAL.  SEGUNDO.  SE DECLARA DISUELTO EL VÍNCULO MATRIMONIAL QUE UNE A ALMA FABIOLA FLORES CASTILLO CON MARCO AURELIO SERAFÍN MUÑOZ, QUEDANDO EN APTITUD DE CONTRAER NUEVO MATRIMONIO O CONTINUAR SU PROYECTO DE VIDA CON LA PERSONA CON QUIEN  QUE DESEEN.  TERCERO. EN VIRTUD DE QUE ESTA SENTENCIA CAUSA EJECUTORIA  POR MINISTERIO DE LEY, REMÍTASE COPIA CERTIFICADA DE LA MISMA AL OFICIAL DEL REGISTRO CIVIL  DONDE SE CELEBRÓ EL MATRIMONIO, PARA QUE SE REALICEN LAS ANOTACIONES MARGINALES CORRESPONDIENTES, EN LOS TÉRMINOS ORDENADO EN EL CONSIDERANDO TERCERO. CUARTO.  NO SE HARÁ  LIQUIDACIÓN DE BIENES.  QUINTO. NO SE DECRETA ESPECIAL CONDENA EN COSTAS PROCESALES.  DESE SALIDA AL EXPEDIENTE EN LOS LIBROS DE GOBIERNO DE ESTE JUZGADO, AVISO DE ELLO POR MEDIO DE ESTADÍSTICA Y EN SU OPORTUNIDAD ARCHÍVESE COMO ASUNTO TOTALMENTE CONCLUIDO.  NOTIFÍQUESE EN TÉRMINOS DEL ARTÍCULO 800 DEL CÓDIGO PROCESAL CIVIL PARA EL ESTADO.  ASÍ LO RESOLVIÓ Y FIRMA LA LICENCIADA DULCE MARÍA PÉREZ GALLARDO, JUEZ DE PARTIDO CIVIL ESPECIALIZADA EN MATERIA FAMILIAR DE ESTE PARTIDO JUDICIAL, QUIEN ACTÚA ASISTIDA POR LA SECRETARIA DEL JUZGADO LICENCIADA MARÍA ELENA RODRÍGUEZ PÉREZ, QUIEN DA FE. GUANAJUATO, GUANAJUATO A 05 DE MARZO DE 2018, EL CIUDADANO OFICIAL DEL REGISTRO CIVIL, LICENCIADO GABRIEL ALEJANDRO ROMERO RAMIREZ, DOY FE.-\r\n","oficialiaNombre":null,"segundoApellido":null,"MAT_EDAD_DEL_CTY":null,"MAT_ERROR_ORIGEN":null,"MAT_NOM_DELA_CTY":"ALMA FABIOLA","MAT_SEXO_DEL_CTY":"M","MAT_TIPO_PERSONA":null,"anioRegMadreElla":0,"anioRegPadreElla":0,"localidadMadreEl":null,"localidadPadreEl":null,"matArchivoOrigen":null,"matDocExtranjero":null,"nacionalidadAux1":0,"nacionalidadAux2":0,"nacionalidadElla":0,"ofiCodigoRegElla":0,"primerApellidoEl":"SERAFIN","MAT_EDAD_DELA_CTY":null,"MAT_SEXO_DELA_CTY":"F","actaBisRegMadreEl":null,"actaBisRegPadreEl":null,"actaNumeroRegElla":0,"entidadCodigoElla":0,"fechaModificacion":null,"fechaNacimientoEl":null,"fechaRegistroDate":"28/06/2002","municipioCodigoEl":0,"nacionalidadElTxt":"MEXICANA","segundoApellidoEl":"MUÑOZ","MAT_ARCHIVO_ORIGEN":null,"MAT_DOC_EXTRANJERO":null,"MAT_NOM_MA_DEL_CTY":"HORTENSIA","MAT_NOM_PA_DEL_CTY":"AURELIO","entidadCodigoRegEl":0,"estadoRegNacNombre":null,"localidadMadreElla":null,"localidadPadreElla":null,"municipioNacNombre":null,"municipioRegNombre":"GUANAJUATO","primerApellidoElla":"FLORES","ENT_COD_NAC_DEL_CTY":"11","MAT_EDAD_MA_DEL_CTY":null,"MAT_EDAD_PA_DEL_CTY":null,"MAT_LOC_NAC_DEL_CTY":"GUANAJUATO","MAT_NOM_MA_DELA_CTY":"MA. GUADALUPE","MAT_NOM_PA_DELA_CTY":"RAFAEL","MAT_SEXO_MA_DEL_CTY":"F","MAT_SEXO_PA_DEL_CTY":"M","MUN_COD_NAC_DEL_CTY":"15","actaBisRegMadreElla":null,"actaBisRegPadreElla":null,"fechaNacimientoElla":null,"imaNombreHomologado":null,"municipioCodigoElla":0,"nacionalidadAux1Txt":null,"nacionalidadAux2Txt":null,"nacionalidadEllaTxt":"MEXICANA","nacionalidadMadreEl":0,"nacionalidadPadreEl":0,"ofiCodigoRegMadreEl":0,"ofiCodigoRegPadreEl":0,"segundoApellidoElla":"CASTILLO","ENT_COD_NAC_DELA_CTY":"11","MAT_EDAD_MA_DELA_CTY":null,"MAT_EDAD_PA_DELA_CTY":null,"MAT_LOC_NAC_DELA_CTY":"IRAPUATO","MAT_SEXO_MA_DELA_CTY":"F","MAT_SEXO_PA_DELA_CTY":"M