null,"nombrePadreElla":null,"notasMarginales":"DE ACUERDO CON LA SENTENCIA DE FECHA 28 DE MAZO DE 2023, DICTADA POR EL C. JUEZ DE PARTIDO ESPECIALIZADO EN MATERIA FAMILIAR DE LEON, GUANAJUATO, EN EL PROCEDIMIENTO DE DIVORCIO INCAUSADO, EXPEDIENTE NÚMERO F1292/2023, EL CUAL CAUSÓ EJECUTORIA CON FECHA 19 DE ABRIL DEL 2023, PROMOVIDO POR MARIA GUADALUPE ESTRADA MEZA EN CONTRA DE BASSAM EZEI, CONFORME A LOS ARTÍCULOS 1° Y 4° DE LA CONSTITUCIÓN POLÍTICA DE LOS ESTADOS UNIDOS MEXICANOS, PARA EL EFECTO DE QUE SE DISUELVA EL VÍNCULO MATRIMONIAL EXISTENTE ENTRE AMBOS, BAJO LOS SIGUIENTES PUNTOS RESOLUTIVOS:\r\n\r\nPRIMERO. - ES PROCEDENTE LA VÍA ORAL ORDINARIA EN QUE SE PLANTEÓ LA ACCIÓN, EN TÉRMINOS DE LO DISPUESTO POR EL ARTÍCULO 822 FRACCIÓN III DEL CÓDIGO DE PROCEDIMIENTOS CIVILES. SEGUNDO. - SE DECLARA LA DISOLUCIÓN DEL VÍNCULO MATRIMONIAL QUE UNE A MARIA GUADALUPE ESTRADA MEZA Y BASSAM EZEI, POR LO QUE AMBOS RECOBRAN SU APTITUD PARA CONTRAER UN NUEVO MATRIMONIO, SI ASÍ LO DESEAN. TERCERO. - UNA VEZ QUE ADQUIERA FIRMEZA LA PRESENTE DETERMINACIÓN, SE ORDENA NOTIFICAR DE MANERA ELECTRÓNICA AL OFICIAL DEL REGISTRO EN DONDE SE CELEBRÓ EL MATRIMONIO, PARA QUE PROCEDA A REALIZAR LAS ANOTACIONES MARGINALES CORRESPONDIENTES. CUARTO. - DADA LA DETERMINACIÓN ASUMIDA POR ESTE JUZGADOR, SE EXONERA A LAS PARTES DEL PAGO DE LAS COSTAS DEL PRESENTE JUICIO, DE CONFORMIDAD CON LO DISPUESTO POR EL ARTÍCULO 12 DEL CÓDIGO DE PROCEDIMIENTOS CIVILES. QUINTO. - TODA VEZ QUE EL MATRIMONIO SE CELEBRÓ BAJO EL RÉGIMEN DE SEPARACIÓN DE BIENES, ATENTO A LO PREVISTO EN EL ARTÍCULO 202 DEL CÓDIGO CIVIL VIGENTE EN EL ESTADO. SEXTO. - SE ORDENA DAR SALIDA AL EXPEDIENTE EN EL LIBRO DE GOBIERNO DE ESTE JUZGADO, AVISO DE ELLO A LA SUPERIORIDAD POR MEDIO DE ESTADÍSTICA MENSUAL Y EN SU OPORTUNIDAD, ARCHÍVESE COMO ASUNTO CONCLUIDO. ORDEN DE NOTIFICACIÓN. NOTIFÍQUESE ELECTRÓNICAMENTE A LA PARTE ACTORA Y POR MEDIO DE LISTA A LA PARTE DEMANDADA. ASÍ LO PROVEYÓ Y FIRMA EL MAESTRO EN JUSTICIA FAMILIAR LICENCIADO FRANCISCO MANUEL MEZA LOEZA, JUEZ DE PARTIDO CIVIL ESPECIALIZADO EN MATERIA DE ORALIDAD FAMILIAR DE ESTE PARTIDO JUDICIAL, QUIEN ACTÚA ASISTIDO LEGALMENTE POR LA SECRETARIA DEL JUZGADO LICENCIADA ELVA ARACELI MACIAS ORNELAS. - DOY FE F1292/2023 LA RESOLUCIÓN ANTERIOR SE NOTIFICÓ POR LISTA, PUBLICADA EN EL TABLERO DE AVISOS DE ESTE JUZGADO A LAS 09:00 HORAS DEL DÍA VEINTINUEVE DE MARZO DEL DOS MIL VEINTITRÉS. DOY FE.\r\n\r\nLO ANTERIOR CON FUNDAMENTO EN EL ARTÍCULO 117 DEL CÓDIGO CIVIL DEL ESTADO. GUANAJUATO, GUANAJUATO A 15 DE SEPTIEMBRE DE 2023. EL C. OFICIAL DEL REGISTRO CIVIL 01 DE GUANAJUATO, GUANAJUATO. C. JOSEFINA FONSECA LOPEZ DOY FE. SELLO DE LA OFICIALÍA. FIRMADO.","oficialiaNombre":null,"segundoApellido":null,"MAT_EDAD_DEL_CTY":null,"MAT_ERROR_ORIGEN":null,"MAT_NOM_DELA_CTY":"MARIA GUADALUPE","MAT_SEXO_DEL_CTY":"M","MAT_TIPO_PERSONA":null,"anioRegMadreElla":0,"anioRegPadreElla":0,"localidadMadreEl":null,"localidadPadreEl":null,"matArchivoOrigen":null,"matDocExtranjero":null,"nacionalidadAux1":0,"nacionalidadAux2":0,"nacionalidadElla":0,"ofiCodigoRegElla":0,"primerApellidoEl":"EZEI","MAT_EDAD_DELA_CTY":null,"MAT_SEXO_DELA_CTY":"F","actaBisRegMadreEl":null,"actaBisRegPadreEl":null,"actaNumeroRegElla":0,"entidadCodigoElla":0,"fechaModificacion":null,"fechaNacimientoEl":null,"fechaRegistroDate":"07/05/2019","municipioCodigoEl":0,"nacionalidadElTxt":"SIRIA","segundoApellidoEl":null,"MAT_ARCHIVO_ORIGEN":null,"MAT_DOC_EXTRANJERO":null,"MAT_NOM_MA_DEL_CTY":"MUNIRA","MAT_NOM_PA_DEL_CTY":"ESAM","entidadCodigoRegEl":0,"estadoRegNacNombre":null,"localidadMadreElla":null,"localidadPadreElla":null,"municipioNacNombre":null,"municipioRegNombre":"GUANAJUATO","primerApellidoElla":"ESTRADA","ENT_COD_NAC_DEL_CTY":null,"MAT_EDAD_MA_DEL_CTY":null,"MAT_EDAD_PA_DEL_CTY":null,"MAT_LOC_NAC_DEL_CTY":"SWAIDA","MAT_NOM_MA_DELA_CTY":"CESAREA","MAT_NOM_PA_DELA_CTY":"J. JESUS","MAT_SEXO_MA_DEL_CTY":"F","MAT_SEXO_PA_DEL_CTY":"M","MUN_COD_NAC_DEL_CTY":null,"actaBisRegMadreElla":null,"acta