INSERT INTO "datos_json" ("id", "datos_json") VALUES ('11015000120230000376', '{"actos":null,"error":"01","folio":null,"warning":null,"msgError":"Sin error","msgWarning":null,"dependencia":null,"matrimonios":[{"ssa":null,"curp":null,"foja":null,"pais":0,"sexo":null,"tomo":null,"folio":622337880,"libro":"1","llave":"1734851","madre":null,"padre":null,"sello":null,"cadena":"31101500012006000120","cripEl":null,"curpEl":"AEMO810113HGTRRM06","edadEl":"25","noActa":null,"nombre":null,"paisEl":0,"sexoEl":"HOMBRE","actaBis":"0","paisTxt":null,"cripElla":null,"curpAux1":null,"curpAux2":null,"curpElla":"CXGA841004MGTRMN03","edadElla":"21","fechaOri":null,"nacMADRE":0,"nacPADRE":0,"nombreEl":"OMAR","paisElla":0,"sexoElla":"MUJER","anioRegEl":0,"curpMADRE":null,"curpPADRE":null,"estadoNac":null,"estadoReg":"11","localidad":null,"municipio":"15","oficialia":"1","CONSIENTEN":null,"nombreElla":"ANGELICA LORENA","numeroActa":"12","valorMovim":"<19/08/2020 12:43:55> Movimiento: ALTA - Proceso de acto efectuado correctamente.","IND_CURP_EL":"AEMO810113HGTRRM06","MAT_CRIP_EL":null,"anioRegElla":0,"codigoCivil":null,"edadMadreEl":0,"edadPadreEl":0,"identElectr":null,"localidadEl":null,"paisMadreEl":0,"paisPadreEl":0,"sexoMadreEl":null,"sexoPadreEl":null,"tipoPersona":null,"actaBisRegEl":null,"anioRegistro":"2006","municipioNac":null,"municipioReg":"15","nacionalidad":0,"IND_CURP_ELLA":"CXGA841004MGTRMN03","MAT_CRIP_ELLA":null,"edadMadreElla":0,"edadPadreElla":0,"fechaRegistro":"13/01/2006","localidadElla":null,"nombreMadreEl":null,"nombrePadreEl":null,"paisMadreElla":0,"paisPadreElla":0,"sexoMadreElla":null,"sexoPadreElla":null,"transcripcion":null,"actaBisRegElla":null,"anioRegMadreEl":0,"anioRegPadreEl":0,"consentimiento":null,"matErrorOrigen":null,"nacionalidadEl":0,"ofiCodigoRegEl":0,"primerApellido":null,"MAT_NOM_DEL_CTY":"OMAR","actaNumeroRegEl":0,"entidadCodigoEl":0,"estadoNacNombre":null,"estadoRegNombre":"GUANAJUATO","fechaNacimiento":null,"municipioNombre":null,"nacionalidadTxt":null,"nombreMadreElla":null,"nombrePadreElla":null,"notasMarginales":"\"DE ACUERDO CON LA SENTENCIA DICTADA  EL 04 DE DICIEMBRE DEL 2015, POR EL  JUEZ  DE PARTIDO ESPECIALIZADO EN MATERIA FAMILIAR DE GUANAJUATO. EN EL JUICIO ORAL ORDINARIO EXPEDIENTE NUMERO F709/2014, EL CUAL CAUSO EJECUTORIA DE FECHA  20 DE ENERO DEL 2020, SOBRE DIVORCIO PROMOVIDO POR ANGELICA LORENA CARRILLO GAMEZ EN CONTRA DE OMAR ARELLANO MARTINEZ DE ACUERDO A LA FRACCIÓN XVIII DEL ARTÍCULO 323 DEL CÓDIGO CIVIL VIGENTE EN EL ESTADO, PARA EL EFECTO DE QUE SE DISUELVA EL VINCULO MATRIMONIAL EXISTENTE ENTRE AMBOS, BAJO LOS SIGUIENTES PUNTOS RESOLUTIVOS: \r\n\r\nPRIMERO.- ESTE JUZGADO RESULTÓ COMPETENTE PARA CONOCER Y RESOLVER EL PRESENTE NEGOCIO. SEGUNDO.- LA VÍA ORAL ORDINARIA ABORDADA POR LA PARTE ACTORA RESULTÓ PROCEDENTE. TERCERO.- LA PARTE ACTORA PROBÓ SU ACCIÓN. LA PARTE DEMANDADA NO SE EXCEPCIONÓ. CUARTO.- DEL CÓDIGO CIVIL DEL ESTADO DE GUANAJUATO, SE DECRETA LA DISOLUCIÓN DEL VÍNCULO MATRIMONIAL QUE UNE A ANGÉLICA LORENA CARRILLO GÁMEZ Y OMAR ARELLANO MARTÍNEZ, EL CUAL SE ENCUENTRA ASENTADO EN EL LIBRO 1 UNO DE MATRIMONIOS, DE FECHA 13 TRECE DE ENERO DE 2006 DOS MIL SEIS, ACTA NÚMERO 00012 DOCE, DE LA OFICIALÍA DEL REGISTRO CIVIL NÚMERO 1 UNO DE LA CIUDAD DE GUANAJUATO, GUANAJUATO. EN VIRTUD DE LO ANTERIOR, AMBOS CÓNYUGES RECUPERAN SU APTITUD PARA CONTRAER NUEVAS NUPCIAS.----\tLA MUJER NO PODRÁ SEGUIR UTILIZANDO EL APELLIDO DE QUIEN HASTA EL DÍA DE HOY FUE SU MARIDO, SI ASÍ LO HUBIERE VENIDO HACIENDO. COMO DEL ACTA DE MATRIMONIO SE ADVIERTE QUE LA UNIÓN SE CONTRAJO BAJO EL RÉGIMEN PATRIMONIAL DE SEPARACIÓN DE BIENES, CADA UNO CONSERVARÁ LOS QUE SEAN DE SU PROPIEDAD. UNA VEZ QUE ESTA RESOLUCIÓN CAUSE EJECUTORIA, SE ORDENA REMITIR COPIA CERTIFICADA DE LA MISMA AL OFICIAL DEL REGISTRO CIVIL NÚMERO 1 UNO DE GUANAJUATO, GUANAJUATO, PARA QUE REALICE LAS ANOTACIONES MARGINALES CORRESPONDIENTES Y ARCHIVE LA COPIA DE LA SENTENCIA CON EL MISMO NÚMERO DEL ACTA DE MATRIMONIO, LO ANTERIOR EN TÉRMINOS DE LOS ARTÍCULOS 117, 118, 119 Y 345 DEL CÓDIGO CIVIL DEL ESTADO DE GUANAJUATO. PROGENITORES SEGUIRÁN CONSERVANDO LA PATRIA POTESTAD QUE EJERCEN SOBRE SU MENOR HIJA ITZIGUERI JOCELYN ARELLANO CARRILLO, QUEDANDO VIGENTES TODAS LAS OBLIGACIONES RELATIVAS A ALIMENTOS. DE LA MISMA FORMA, DE ACUERDO A LO DISPUESTO POR EL ÚLTIMO PÁRRAFO DE LA FRACCIÓN XVIII DEL ARTÍCULO 323 DEL CÓDIGO CIVIL DEL ESTADO DE GUANAJUATO, EN RELACIÓN CON EL NUMERAL 337, FRACCIÓN SEGUNDA, DEL MISMO CUERPO LEGAL, Y EN ATENCIÓN AL INTERÉS SUPERIOR DE LA HIJA HABIDA EN EL MATRIMONIO QUE SE DISUELVE, SE DETERMINA QUE LA GUARDA Y CUSTODIA DE LA MENOR ITZIGUERI JOCELYN ARELLANO CARRILLO, LA SEGUIRÁ TENIENDO EL PROGENITOR CON QUIEN HAYA ESTADO VIVIENDO DESDE LA SEPARACIÓN CONYUGAL. QUINTO.- CON FUNDAMENTO EN LO DISPUESTO POR EL ARTÍCULO 12 DEL CÓDIGO DE PROCEDIMIENTOS CIVILES PARA EL ESTADO DE GUANAJUATO, SE EXONERA A LA PARTE DEMANDADA DEL PAGO DE COSTAS. SEXTO.- NOTIFÍQUESE PERSONALMENTE A LA PARTE ACTORA Y AL AGENTE DEL MINISTERIO PÚBLICO ADSCRITO A ESTE JUZGADO Y POR MEDIO DE EDICTOS A LA PARTE DEMANDADA. DESE  SALIDA  AL  EXPEDIENTE  EN  LOS  LIBROS  DE  GOBIERNO DE ESTE JUZGADO, AVISO DE ELLO EN ESTADÍSTICA Y EN SU OPORTUNIDAD ARCHÍVESE COMO ASUNTO CONCLUIDO. ASÍ LO RESOLVIÓ Y FIRMA EL CIUDADANO LICENCIADO ELOY ZAVALA ARREDONDO, JUEZ DE PARTIDO CIVIL ESPECIALIZADO EN MATERIA FAMILIAR, QUIEN ACTÚA ASISTIDO LEGALMENTE POR LA SECRETARIA DE ACUERDOS DEL JUZGADO CIUDADANA LICENCIADA MARÍA DOLORES RODRÍGUEZ ALMEIDA.- DOY FE. NOTIFÍQUESE POR LISTA A LAS PARTES Y ELECTRÓNICAMENTE AL REGISTRO CIVIL.CÚMPLASE. ASÍ LO RESOLVIÓ Y FIRMA LA CIUDADANA MAESTRA MARÍA EVA GALVÁN PATLÁN, JUEZ DE PARTIDO ESPECIALIZADO EN MATERIA FAMILIAR, QUIEN ACTÚA ASISTIDO LEGALMENTE POR LA SECRETARIA DEL JUZGADO CIUDADANA LICENCIADA MARÍA ELENA RODRÍGUEZ PÉREZ.- DOY FE. \r\nSE HACE LA PRESENTE ANOTACIÓN CON FUNDAMENTO EN EL ARTÍCULO 117 DEL CÓDIGO CIVIL VIGENTE EN EL ESTADO. GUANAJUATO, GUANAJUATO A 19 DE AGOSTO DEL 2020, EL CIUDADANO OFICIAL DEL REGISTRO CIVIL, LIC. GABRIEL ALEJANDRO ROMERO RAMIREZ DOY FE.-","oficialiaNombre":null,"segundoApellido":null,"MAT_EDAD_DEL_CTY":null,"MAT_ERROR_ORIGEN":null,"MAT_NOM_DELA_CTY":"ANGELICA LORENA","MAT_SEXO_DEL_CTY":"M","MAT_TIPO_PERSONA":null,"anioRegMadreElla":0,"anioRegPadreElla":0,"localidadMadreEl":null,"localidadPadreEl":null,"matArchivoOrigen":null,"matDocExtranjero":null,"nacionalidadAux1":0,"nacionalidadAux2":0,"nacionalidadElla":0,"ofiCodigoRegElla":0,"primerApellidoEl":"ARELLANO","MAT_EDAD_DELA_CTY":null,"MAT_SEXO_DELA_CTY":"F","actaBisRegMadreEl":null,"actaBisRegPadreEl":null,"actaNumeroRegElla":0,"entidadCodigoElla":0,"fechaModificacion":null,"fechaNacimientoEl":null,"fechaRegistroDate":"13/01/2006","municipioCodigoEl":0,"nacionalidadElTxt":"MEXICANA","segundoApellidoEl":"MARTINEZ","MAT_ARCHIVO_ORIGEN":null,"MAT_DOC_EXTRANJERO":null,"MAT_NOM_MA_DEL_CTY":"MA. GUADALUPE","MAT_NOM_PA_DEL_CTY":"SERVANDO","entidadCodigoRegEl":0,"estadoRegNacNombre":null,"localidadMadreElla":null,"localidadPadreElla":null,"municipioNacNombre":null,"municipioRegNombre":"GUANAJUATO","primerApellidoElla":"CARRILLO","ENT_COD_NAC_DEL_CTY":"11","MAT_EDAD_MA_DEL_CTY":null,"MAT_EDAD_PA_DEL_CTY":null,"MAT_LOC_NAC_DEL_CTY":"APASEO EL ALTO","MAT_NOM_MA_DELA_CTY":"CELIA","MAT_NOM_PA_DELA_CTY":"JACINTO","MAT_SEXO_MA_DEL_CTY":"F","MAT_SEXO_PA_DEL_CTY":"M","MUN_COD_NAC_DEL_CTY":"4","actaBisRegMadreElla":null,"actaBisRegPadreElla":null,"fechaNacimientoElla":null,"imaNombreHomologado":null,"municipioCodigoElla":0,"nacionalidadAux1Txt":null,"nacionalidadAux2Txt":null,"nacionalidadEllaTxt":"MEXICANA","nacionalidadMadreEl":0,"nacionalidadPadreEl":0,"ofiCodigoRegMadreEl":0,"ofiCodigoRegPadreEl":0,"segundoApellidoElla":"GAMEZ","ENT_COD_NAC_DELA_CTY":"11","MAT_EDAD_MA_DELA_CTY":null,"MAT_EDAD_PA_DELA_CTY":null,"MAT_LOC_NAC_DELA_CTY":"GUANAJUATO","MAT_SEXO_MA_DELA_CTY":"F","MAT_SEXO_PA_DELA_CTY":"M","MUN_COD_NAC_DELA_CTY":"15","NAC_ANIO_REG_DEL_CTY":null,"actaNumeroRegMadreEl":0,"a