QUE UNE A LOS SEÑORES J. JESÚS VERVER Y VARGAS MACÍAS Y MA. TERESA FUNES DE EZCURDIA, CELEBRADO ANTE EL OFICIAL DEL REGISTRO CIVIL DE ESTA CIUDAD, EL DÍA 17 DIECISIETE DE AGOSTO DE 1968 MIL NOVECIENTOS SESENTA Y OCHO, QUEDANDO LOS PROMOVENTES EN APTITUD DE CONTRAER NUEVO MATRIMONIO NO PUDIENDO HACERLO SINO HASTA QUE TRASCURRA UN AÑO CONTADO A PARTIR DE QUE LA PRESENTE RESOLUCIÓN CUASE EJECUTORIA. LA MUJER NO PODRÁ SEGUIR UTILIZANDO EL APELLIDO DEL MARIDO. - SEGUNDO. - LA SITUACIÓN DE LOS MENORES HIJOS DE LOS PROMOVENTES Y DE NOMBRES LUIS CARLOS E ITZIA AMBOS DE APELLLIDOS VERVER Y VARGAS FUNES QUEDA COMO SIGUE: QUEDARAN BAJO LA CUSTODIA Y GUARDA DE SU SEÑORA MADRE, EJERCIENDO AMBOS PROGENITORES LA PATRIA POTESTAD RESPECTO DEL ELLOS, EL CAMBIO DE DOMICILIO QUEDA SUJETO AL ACUERDO DE LOS PADRES PREVIA OPINIÓN DE LOS HIJOS, LO CUAL REGIRÁ DURANTE Y DESPUÉS DE LA RESOLUCIÓN DEFINITIVA DE ESTE PROCESO; PUDIENDO EL SEÑOR VERVER Y VARGAS MACÍAS VER A SUS HIJOS EN LOS TÉRMINOS DEL CONVENIO CELEBRADO POR AMBOS. ASIMISMO, SE OBLIGA A PROPORCIONAR A LA PROMOVENTE Y SUS MENORES HIJOS EL CUARTENTA POR CIENTO DE LOS INGRESOS MENSUALES QUE PERCIBA DE LA FECHA DE PRESENTACIÓN DE SUS ESCRITO INICIAL HASTA LA EXTINCIÓN DE SU OBLIGACIÓN DE OTORGAR ALIMENTOS. UNA VEZ QUE ESTA RESOLUCIÓN CAUSE EJECUTORIA, REMÍTASE ATENTO OFICIO A SECRETARÍA DE EDUCACIÓN, CULTURA Y RECREACIÓN, CON DOMICILIO EN PLAZA DE LA PAZ NÚMERO 14, CATORCE DE ESTA CIUDAD A EFECTO DE QUE SE PROCEDA A EFECTUAR EL DESCUENTO PACTADO POR LOS PROMOVENTES RESPECTO DEL SUELDO PERCIBIDO POR EL ACCIONANTE SEÑOR J. JESÚS VERVER Y VARGAS MACÍAS. - ASIMISMO EN CASO DE QUE LA SEÑORA MA. TERESA FUENES OBTENGA INGRESOS POR TRABAJO RENUMERADO APORTARÁ UN PORCENTAJE IGUAL DE 40% CUARENTA POR CIENTO DE SU SALARIO POR CONCEPTO DE PENSIÓN ALIMENTICIA PARA SUS HIJOS.- TERCERO.- NO SE HACE ESPECIAL CONDENA EN COSTAS.- CUARTO.- UNA VEZ QUE LA PRESENTE RESOLUCIÓN CAUSE EJECUTORIA REMÍTASE COPIA CERTIFICADA DE LA MISMA AL OFICIAL DEL REGISTRO CIVIL DE ESTA CIUDAD, A FIN DE QUE PROCEDA EN LOS TÉRMINOS DEL ARTÍCULO 117 CIENTO DIECISIETE DE LA LEY SUSTANTIVA EN LA MATERIA.- QUINTO.- DÉSELE SALIDA AL EXPEDIENTE EN LOS LIBROS DE GOBIENRO DE ESTE JUZGADO Y EN SU OPORTUNIDAD ARCHÍVESE COMO ASUNTO CONLUÍDO. SEXTO.- NOTIFÍQUESE.- ASÍ LO RESOLVIÓ Y FIRMA EL CIUDADANO LICENCIADO HÉCTOR MANUEL RAMÍREZ SÁNCHEZ, JUEZ DE PRIMERA INSTANCIA CIVIL DE ESTE PARTIDO JUDICIAL, ACTUANDO CON SECRETARIO.- DOY FE.- ","oficialiaNombre":null,"segundoApellido":null,"tipoDivorcioTxt":"ADMINISTRATIVO","DIV_TIPO_PERSONA":"N","MAT_ACTA_BIS_REG":null,"MAT_ENT_REG_DESC":null,"MAT_MUN_REG_DESC":null,"localidadNacElla":null,"matActaNumeroReg":0,"municipioNacElla":0,"nacionalidadAux1":0,"nacionalidadAux2":0,"nacionalidadElla":0,"ofiCodigoRegElla":0,"primerApellidoEl":"VERVER Y VARGAS","DIV_TIPO_DIVORCIO":"1","DIV_TRANSCRIPCION":null,"MAT_OFICIALIA_REG":null,"fechaModificacion":null,"fechaNacimientoEl":null,"nacionalidadElTxt":"MEXICANA","segundoApellidoEl":"MACIAS","divResolucionAdmva":"FRACCION XVII DEL ARTÍCULO 323 DEL CÓDIGO CIVIL PARA EL ESTADO DE GUANAJUATO","entidadCodigoRegEl":0,"estadoRegNacNombre":null,"fechaRegActaMatDiv":null,"municipioNacNombre":null,"municipioRegNombre":"GUANAJUATO","primerApellidoElla":"FUNES","DIV_EDAD_DIVORCIADA":"79","DIV_EDAD_DIVORCIADO":"82","DIV_SEXO_DIVORCIADA":"F","DIV_SEXO_DIVORCIADO":"M","MAT_ACTA_NUMERO_REG":null,"fechaNacimientoElla":null,"imaNombreHomologado":null,"nacionalidadAux1Txt":null,"nacionalidadAux2Txt":null,"nacionalidadEllaTxt":"MEXICANA","segundoApellidoElla":"DE EZCURDIA","DIV_FECHA_RESOLUCION":null,"DIV_RESOLUCION_ADMVA":"FRACCION XVII DEL ARTÍCULO 323 DEL CÓDIGO CIVIL PARA EL ESTADO DE GUANAJUATO","entidadCodigoRegElla":0,"fechaNacimientoElTxt":"08/04/1940","municipioCodigoRegEl":0,"nombrePrimeraPersona":null,"nombreSegundaPersona":null,"DIV_NOMBRE_DIVORCIADA":"MA. TERESA","DIV_NOMBRE_DIVORCIADO":"J. JESUS","DIV_PRI_AP_DIVORCIADA":"FUNES","DIV_PRI_AP_DIVORCIADO":"VERVER Y VARGAS","