dadTxt":null,"nombreMadreElla":null,"nombrePadreElla":null,"notasMarginales":"DE ACUERDO CON LA SENTENCIA DICTADA EL 25 DE ABRIL  DEL 2019 POR LA C. JUEZ  DE PARTIDO CIVIL ESPECIALIZADA EN MATERIA DE ORALIDAD  FAMILIAR  DEL PARTIDO JUDICIAL  DE GUANAJUATO, GTO., EN  EL EXPEDIENTE TRAMITADO BAJO EL NÚMERO F-0365/2019 RELATIVO AL PROCESO ORAL ORDINARIO PROMOVIDO POR MARIA ISABEL CALDERON MORENO EN CONTRA DE ALFONSO CHIA AVILA SOBRE DISOLUCIÓN DE VÍNCULO MATRIMONIAL Y OTRAS PRESTACIONES QUE CAUSA EJECUTORIA POR MINISTERIO DE LEY AL ESTAR LAS PARTES CONFORMES CON LA SENTENCIA  PARA EL EFECTO DE QUE SE DISUELVA EL VINCULO MATRIMONIAL EXISTENTE ENTRE  AMBOS BAJO LOS SIGUIENTES  PUNTOS RESOLUTIVOS:\r\n\r\nPRIMERO.- ESTA JUZGADORA FUE COMPETENTE PARA CONOCER Y RESOLVER EL PRESENTE ASUNTO. SEGUNDO.- LA VÍA ORAL ORDINARIA BAJO LA QUE SE TRAMITÓ EL PROCEDIMIENTO FUE LA ADECUADA. TERCERO.-CONFORME A LOS RAZONAMIENTOS Y FUNDAMENTOS DE DERECHO ASENTADOS EN LA PRESENTE RESOLUCIÓN, SE ACREDITÓ LA PROCEDENCIA DE LA PRETENSIÓN DE DIVORCIO. CUARTO.-POR TANTO, CON FUNDAMENTO EN LOS ARTÍCULOS 1° Y 4° DE LA CONSTITUCIÓN POLÍTICA DE LOS ESTADOS UNIDOS MEXICANOS, SE DECLARA LA DISOLUCIÓN DEL VÍNCULO MATRIMONIAL QUE UNE A MARIA ISABEL CALDERON MORENO Y ALFONSO CHIA AVILA, MISMO QUE SE ENCUENTRA ASENTADO EN EL ACTA NÚMERO 00341 TRESCIENTOS CUARENTA Y UNO, DE FECHA 26 VEINTISÉIS DE JULIO DE 2010 DOS MIL DIEZ, EN EL LIBRO NÚMERO 2 DOS DE MATRIMONIOS, DE LA OFICIALÍA DEL REGISTRO CIVIL NÚMERO 01 UNO DE GUANAJUATO, GUANAJUATO, RECUPERANDO AMBOS SU APTITUD PARA CONTRAER NUEVA UNIÓN. POR OTRA PARTE, COMO DEL ACTA DE MATRIMONIO DE MARIA ISABEL CALDERON MORENO Y ALFONSO CHIA AVILA SE ADVIERTE QUE LO CONTRAJERON BAJO EL RÉGIMEN PATRIMONIAL DE SEPARACIÓN DE BIENES, CADA UNO CONSERVARÁ LOS QUE SEAN DE SU PROPIEDAD. UNA VEZ QUE CAUSE EJECUTORIA LA PRESENTE SENTENCIA Y EN CUMPLIMIENTO A LA CIRCULAR 2/2019-CPJ EXPEDIDA POR LA PRESIDENTA DEL SUPREMO TRIBUNAL DE JUSTICIA DEL ESTADO DE GUANAJUATO DE FECHA 28 VEINTIOCHO DE FEBRERO DE 2019 DOS MIL DIECINUEVE SE ORDENA NOTIFICAR ELECTRÓNICAMENTE A LA OFICIALÍA DONDE SE CELEBRÓ EL MATRIMONIO; Y SE DÉ DEBIDO CUMPLIMIENTO A LO ESTABLECIDO EN LOS ARTÍCULOS 117, 118 Y 119 DEL CÓDIGO CIVIL VIGENTE EN EL ESTADO, EN RELACIÓN CON EL DIVERSO 345 DEL MISMO ORDENAMIENTO LEGAL INVOCADO. POR OTRA PARTE, MARIA ISABEL CALDERON MORENO Y ALFONSO CHIA AVILA SEGUIRÁN CONSERVANDO LA PATRIA POTESTAD QUE EJERCEN SOBRE SUS HIJOS DEREK ALONSO Y KIMBERLY ISABELLE DE APELLIDOS CHIA CALDERON. LO RELATIVO A LAS AUTORIZACIONES SOLICITADAS EN LA DEMANDA, A LOS ALIMENTOS A FAVOR DE DEREK ALONSO Y KIMBERLY ISABELLE DE APELLIDOS CHIA CALDERON, ASÍ COMO A LAS CUESTIONES RELATIVAS A CUSTODIA Y CONVIVENCIA, SE SUJETARÁN A LOS TÉRMINOS DEL CONVENIO CELEBRADO POR LOS PROGENITORES MARIA ISABEL CALDERON MORENO Y ALFONSO CHIA AVILA, LO CUAL FUE PRECISADO EN SUS ALCANCES ANTE LA PRESENCIA JUDICIAL, Y SE ENCUENTRA INSERTO EN EL ACTA DE AUDIENCIA, ASÍ COMO EN LA GRABACIÓN EN AUDIO Y VIDEO, LO QUE FUE RATIFICADO EN LA PROPIA AUDIENCIA ANTE LA PRESENCIA JUDICIAL POR LAS PARTES Y TODA VEZ QUE SE ENCUENTRA AJUSTADO A LA LEY, POR ESTAR GARANTIZADOS LOS DERECHOS DE LOS HIJOS MENORES DE EDAD, SE APRUEBA EL CONVENIO, DE CONFORMIDAD CON LO DISPUESTO EN EL ARTÍCULO 2446 DEL CÓDIGO CIVIL. QUINTO.- CON FUNDAMENTO EN LO DISPUESTO POR EL ARTÍCULO 12 DEL CÓDIGO DE PROCEDIMIENTOS CIVILES PARA EL ESTADO DE GUANAJUATO, NO SE HACE ESPECIAL CONDENA EN COSTAS PROCESALES. SEXTO.- NOTIFÍQUESE LA PRESENTE RESOLUCIÓN EN FORMA PERSONAL A LAS PARTES, AL MINISTERIO PÚBLICO ADSCRITO Y A LA PROCURADURÍA ESTATAL DE PROTECCIÓN DE NIÑAS, NIÑOS Y ADOLESCENTES. DESE  SALIDA  AL  EXPEDIENTE  EN  LOS  LIBROS  DE  GOBIERNO DE ESTE JUZGADO, AVISO DE ELLO EN ESTADÍSTICA Y EN SU OPORTUNIDAD ARCHÍVESE COMO ASUNTO CONCLUIDO. ASÍ LO RESOLVIÓ Y FIRMA LA CIUDADANA LICENCIADA DULCE MARIA PEREZ GALLARDO, JUEZ DE PARTIDO CIVIL ESPECIALIZADA EN MATERIA FAMILIAR, QUIEN ACTÚA ASISTIDA POR LA SECRETARIA DE ACUERDOS DEL JUZGADO CIUDADANA LICENCIADA MARÍA ELENA RODRÍGUEZ PÉREZ QUIEN DA FE.\r\n\r\nSE HACE","oficialiaNombre":null,"segundoApellido":null,"MAT_EDAD_DEL_CTY":null,"MAT_ERROR_ORIGEN":null,"MAT_NOM_DELA_CTY":"MARIA ISABEL","MAT_SEXO_DEL_CTY":"M","MAT_TIPO_PERSONA":null,"anioRegMadreElla":0,"anioRegPadreElla":0,"localidadMadreEl":null,"localidadPadreEl":null,"matArchivoOrigen":null,"matDocExtranjero":null,"nacionalidadAux1":0,"nacionalidadAux2":0,"nacionalidadElla":0,"ofiCodigoRegElla":0,"primerApellidoEl":"CHIA","MAT_EDAD_DELA_CTY":null,"MAT_SEXO_DELA_CTY":"F","actaBisRegMadreEl":null,"actaBisRegPadreEl":null,"actaNumeroRegElla":0,"entidadCodigoElla":0,"fechaModificacion":null,"fechaNacimientoEl":null,"fechaRegistroDate":"26/07/2010","municipioCodigoEl":0,"nacionalidadElTxt":"MEXICANA","segundoApellidoEl":"AVILA","MAT_ARCHIVO_ORIGEN":null,"MAT_DOC_EXTRANJERO":null,"MAT_NOM_MA_DEL_CTY":"MARIA","MAT_NOM_PA_DEL_CTY":"LUCAS","entidadCodigoRegEl":0,"estadoRegNacNombre":null,"localidadMadreElla":null,"localidadPadreElla":null,"municipioNacNombre":null,"municipioRegNombre":"GUANAJUATO","primerApellidoElla":"CALDERON","ENT_COD_NAC_DEL_CTY":"11","MAT_EDAD_MA_DEL_CTY":null,"MAT_EDAD_PA_DEL_CTY":null,"MAT_LOC_NAC_DEL_CTY":"GUANAJUATO","MAT_NOM_MA_DELA_CTY":"EMILIA","MAT_NOM_PA_DELA_CTY":"J. ASCENCION","MAT_SEXO_MA_DEL_CTY":"F","MAT_SEXO_PA_DEL_CTY":"M","MUN_COD_NAC_DEL_CTY":"15","actaBisRegMadreElla":null,"actaBisRegPadreElla":null,"fechaNacimientoElla":null,"imaNombreHomologado":null,"municipioCodigoElla":0,"nacionalidadAux1Txt":null,"nacionalidadAux2Txt":null,"nacionalidadEllaTxt":"MEXICANA","nacionalidadMadreEl":0,"nacionalidadPadreEl":0,"ofiCodigoRegMadreEl":0,"ofiCodigoRegPadreEl":0,"segundoApellidoElla":"MORENO","ENT_COD_NAC_DELA_CTY":"11","MAT_EDAD_MA_DELA_CTY":null,"MAT_EDAD_PA_DELA_CTY":null,"MAT_LOC_NAC_DELA_CTY":"GUANAJUATO","MAT_SEXO_MA_DELA_CTY":"F","MAT_SEXO_PA_DELA_CTY":"M","MUN_COD_NAC_DELA_CTY":"15","NAC_ANIO_REG_DEL_CTY":null,"actaNumeroRegMadreEl":0,"actaNumeroRegP