INSERT INTO "datos_json" ("id", "datos_json") VALUES ('11015000120230000833', '{"actos":null,"error":"01","folio":null,"warning":null,"msgError":"Sin error","msgWarning":null,"dependencia":null,"nacimientos":[{"ssa":null,"curp":"COLE031018MGTRRGA2","foja":null,"pais":223,"sexo":"F","tomo":"0","folio":622360692,"libro":"13","madre":"MARTHA ELISA LORETO MOJICA","padre":"GUSTAVO CORDERO CABRERA","sello":"","cadena":"11101500012003024220","noActa":"2422","nombre":"EUGENIA","actaBis":"0","paisTxt":"MEXICO","curpAux1":null,"curpAux2":null,"nacMADRE":0,"nacPADRE":0,"curpMADRE":"","curpPADRE":"","estadoNac":"11","estadoReg":"11","localidad":"LEON","municipio":"20","oficialia":"1","numeroActa":"2422","valorMovim":"<30/07/2018 10:17:01> Movimiento: ALTA - Proceso de acto efectuado correctamente.","vivoMuerto":"V","codigoCivil":"Se extiende la presente copia certificada, con fundamento en el artículos 56 del Código Civil del Estado de Guanajuato.","identElectr":null,"nacMadreTxt":"MEXICANA","nacPadreTxt":"MEXICANA","tipoPersona":"N","anioRegistro":"2003","municipioNac":"20","municipioReg":"15","nacionalidad":223,"fechaRegistro":"18/12/2003","transcripcion":null,"primerApellido":"CORDERO","estadoNacNombre":"GUANAJUATO","estadoRegNombre":"GUANAJUATO","fechaNacimiento":"18/10/2003","municipioNombre":"LEON","nacionalidadTxt":"MEXICO","notasMarginales":"DE ACUERDO CON LA SENTENCIA DICTADA EL 27 DE JUNIO DEL 2016, POR EL C. JUEZ CIVIL ESPECIALIZADO EN MATERIA FAMILIAR DE  ORALIDAD FAMILIAR DEL JUZGADO  SEGUNDO  CIVIL DE ESTE  PARTIDO JUDICIAL DE SILAO, GUANAJUATO EN EL PROCEDIMIENTO ORAL ESPECIAL, EXPEDIENTE NUMERO F450/2016, RESOLUCIÓN QUE CAUSO EJECUTORIA CON FECHA 13 DE  JULIO DEL 2016, SOBRE LA ADOPCIÓN DE EUGENIA RENDÓN HUERTA LORETO, A FAVOR DE  GUSTAVO  CORDERO CABRERA, DE NACIONALIDAD MEXICANA, ORIGINARIO DE GUANAJUATO,  GUANAJUATO,  MÉXICO BAJO LOS SIGUIENTES PUNTOS RESOLUTIVOS PRIMERO.- ESTE JUZGADO  ES  JURÍDICAMENTE  COMPETENTE PARA  CONOCER Y RESOLVER EL PRESENTE PROCEDIMIENTO SEGUNDO.- LA  VÍA  ORAL ESPECIAL POR LA  CUAL SE PROMOVIÓ ESTE PROCEDIMIENTO FUE LEGALMENTE CORRECTA, TERCERO.- EL  PROMOVENTE GUSTAVO CORDERO CABRERA CUMPLIÓ CON  LOS REQUISITOS DE LEY PARA LA PROCEDENCIA DE LA  ADOPCIÓN  DE LA  MENOR DE EDAD EUGENIA RENDÓN HUERTA LORETO, POR TANTO,  SE  APRUEBA LA  ADOPCIÓN SIMPLE DE LA ADOLESCENTE EUGENIA RENDÓN HUERTA LORETO, EN  FAVOR  DE GUSTAVO CORDERO CABRERA EN  SU CARÁCTER DE CÓNYUGE DE  MARTHA ELISA LORETO  MOJICA, ESTA ÚLTIMA MADRE BIOLÓGICA DE LA  INFANTE, ADQUIRIENDO  EL ADOPTANTE EL  EJERCICIO DE LA PATRIA POTESTAD DE LA  ADOLESCENTE, ADQUIRIENDO LAZOS DE PARENTESCO LOS  CUALES  SE  LIMITAN  ENTRE ADOPTANTE  Y  ADOPTADO, EXCEPTO EN  LO RELATIVO A  LOS  IMPEDIMENTOS DE MATRIMONIO QUE SE EXTIENDE EN  DICHO IMPEDIMENTO  CON  TODOS LOS  PARIENTES DEL ADOPTANTE, COMO SI HUBIERA FILIACIÓN  CONSANGUÍNEA. NO SE EXTINGUIRÁN LOS VÍNCULOS CONSANGUÍNEOS CON LA  FAMILIA  DEL SEÑOR JOSÉ DE JESÚS RENDÓN  HUERTA BARRERA,  ES DECIR CON LA  FAMILIA PATERNA DE LA  ADOPTADA. LA ADOPTADA LLEVARÁ EL  APELLIDO DEL ADOPTANTE. UNA VEZ  QUE ESTA  RESOLUCIÓN  CAUSE  EJECUTORIA LA ADOPCIÓN  SIMPLE QUEDARA CONSUMADA DE  CONFORMIDAD CON  LO  DISPUESTO EN  LOS  ARTÍCULOS  463 Y 464 DEL  CÓDIGO CIVIL  DEL ESTADO DE GUANAJUATO, EN  CONSECUENCIA, SE ORDENA  REMITIR EL  DUPLICADO DEL PRESENTE EXPEDIENTE AL  OFICIAL NUMERO 01 DE GUANAJUATO,  GUANAJUATO, PARA  QUE REALICE LAS  ANOTACIÓN CORRESPONDIENTE EN  EL ACTA  DE NACIMIENTO DE LA  ADOLESCENTE EUGENIA  RENDÓN HUERTA  LORETO; MISMA QUE  OBRA IDENTIFICADA CON  EL  NUMERO 02422 DE FECHA DIECIOCHO DE  DICIEMBRE DEL  AÑO  DOS  MIL  TRES, ASENTADA EN  EL   LIBRO 13 DE  NACIMIENTO, Y; LEVANTADA EL ACTA  DE NACIMIENTO  CORRESPONDIENTE EN  LA QUE  DEBERÁ ASENTARSE COMO  NOMBRE: EUGENIA CORDERO LORETO, FIGURANDO  COMO  SU PADRE: GUSTAVO CORDERO CABRERA; EDAD 53 AÑOS; LUGAR  DE  NACIMIENTO: GUANAJUATO,  GUANAJUATO, MÉXICO; FECHA DE NACIMIENTO: VEINTIOCHO DE DICIEMBRE DE  MIL NOVECIENTOS SESENTA  Y  DOS,