l,"nacionalidadTxt":null,"nombreMadreElla":null,"nombrePadreElla":null,"notasMarginales":"DE ACUERDO CON LA SENTENCIA DE FECHA 23 DE FEBRERO DE 2023, DICTADA POR LA C. JUEZ DE ORALIDAD FAMILIAR DEL PARTIDO JUDICIAL DE GUANAJUATO, GUANAJUATO, EN EL PROCEDIMIENTO ORAL ESPECIAL, EXPEDIENTE NÚMERO F0137/2023 EL CUAL CAUSÓ EJECUTORIA POR MINISTERIO DE LEY, SOBRE DIVORCIO POR MUTUO CONSENTIMIENTO PROMOVIDO POR LOS C.C. CLARISA IVONNE MURRIETA GARCÍA Y BRENDA MARÍA MÁRQUEZ RAMÍREZ, CONFORME A LA CAUSAL XVII DEL ARTÍCULO 323 DEL CÓDIGO CIVIL VIGENTE EN EL ESTADO, PARA EL EFECTO DE QUE SE DISUELVA EL VÍNCULO MATRIMONIAL EXISTENTE ENTRE AMBOS, BAJO LOS SIGUIENTES PUNTOS RESOLUTIVOS:\r\n\r\nPRIMERO. ESTA JUZGADORA FUE COMPETENTE PARA CONOCER Y RESOLVER LA SOLICITUD Y LA VÍA ORAL ESPECIAL FUE LA ADECUADA. SEGUNDO.  SE DECLARA DISUELTO EL VÍNCULO MATRIMONIAL QUE UNE A CLARISA IVONNE MURRIETA GARCÍA Y BRENDA MARÍA MÁRQUEZ RAMÍREZ, QUEDANDO EN APTITUD DE CONTRAER NUEVO MATRIMONIO O CONTINUAR SU PROYECTO DE VIDA CON LA PERSONA CON QUIEN DESEEN. TERCERO. EN VIRTUD DE QUE ESTA SENTENCIA CAUSA EJECUTORIA POR MINISTERIO DE LEY, SE ORDENA NOTIFICAR ELECTRÓNICAMENTE AL OFICIAL DEL REGISTRO CIVIL DONDE SE CELEBRÓ EL MATRIMONIO, EN LOS TÉRMINOS ORDENADOS EN EL CONSIDERANDO TERCERO. CUARTO. NO SE HACE LIQUIDACIÓN DE BIENES DADO QUE LAS PARTES SE CASARON BAJO EL RÉGIMEN PATRIMONIAL DE SEPARACIÓN DE BIENES, ATENTO A LO PREVISTO EN EL NUMERAL 202 DEL CÓDIGO SUSTANTIVO. QUINTO. NO SE DECRETA ESPECIAL CONDENA EN COSTAS PROCESALES. DESE SALIDA AL EXPEDIENTE EN LOS LIBROS DE GOBIERNO DE ESTE JUZGADO, AVISO DE ELLO POR MEDIO DE ESTADÍSTICA Y EN SU OPORTUNIDAD ARCHÍVESE COMO ASUNTO TOTALMENTE CONCLUIDO. NOTIFÍQUESE EN TÉRMINOS DEL ARTÍCULO 800 DEL CÓDIGO PROCESAL CIVIL PARA EL ESTADO. ASÍ LO RESOLVIÓ Y FIRMA LA LICENCIADA DULCE MARIA PEREZ GALLARDO, JUEZ DE PARTIDO ESPECIALIZADO EN MATERIA FAMILIAR, QUIEN ACTÚA ASISTIDA LEGALMENTE POR LA SECRETARIA DEL JUZGADO LICENCIADA MARÍA ELENA RODRÍGUEZ PÉREZ.- QUIEN DA FE.\r\n\r\nLO ANTERIOR CON FUNDAMENTO EN LOS ARTÍCULOS 117 DEL CÓDIGO CIVIL DEL ESTADO, 365 FRACCIÓN I Y 366 DEL CÓDIGO DE PROCEDIMIENTOS CIVILES PARA EL ESTADO.  GUANAJUATO, GUANAJUATO; A 04 DE JULIO DE 2024. EL C. OFICIAL DEL REGISTRO CIVIL 01 DE GUANAJUATO, GUANAJUATO.  LICENCIADO RAFAEL ALBERTO GARCÍA LOZA.  DOY FE.  SELLO DE LA OFICIALÍA. FIRMADO.\r\n\r\n","oficialiaNombre":null,"segundoApellido":null,"MAT_EDAD_DEL_CTY":null,"MAT_ERROR_ORIGEN":"Proceso de acto efectuado correctamente.","MAT_NOM_DELA_CTY":"BRENDA MARIA","MAT_SEXO_DEL_CTY":"F","MAT_TIPO_PERSONA":null,"anioRegMadreElla":0,"anioRegPadreElla":0,"localidadMadreEl":null,"localidadPadreEl":null,"matArchivoOrigen":null,"matDocExtranjero":null,"nacionalidadAux1":0,"nacionalidadAux2":0,"nacionalidadElla":0,"ofiCodigoRegElla":0,"primerApellidoEl":"MURRIETA","MAT_EDAD_DELA_CTY":null,"MAT_SEXO_DELA_CTY":"F","actaBisRegMadreEl":null,"actaBisRegPadreEl":null,"actaNumeroRegElla":0,"entidadCodigoElla":0,"fechaModificacion":null,"fechaNacimientoEl":null,"fechaRegistroDate":"23/03/2021","municipioCodigoEl":0,"nacionalidadElTxt":"MEXICANA","segundoApellidoEl":"GARCIA","MAT_ARCHIVO_ORIGEN":null,"MAT_DOC_EXTRANJERO":null,"MAT_NOM_MA_DEL_CTY":"MARTHA","MAT_NOM_PA_DEL_CTY":"SALVADOR","entidadCodigoRegEl":0,"estadoRegNacNombre":null,"localidadMadreElla":null,"localidadPadreElla":null,"municipioNacNombre":null,"municipioRegNombre":"GUANAJUATO","primerApellidoElla":"MARQUEZ","ENT_COD_NAC_DEL_CTY":"11","MAT_EDAD_MA_DEL_CTY":null,"MAT_EDAD_PA_DEL_CTY":null,"MAT_LOC_NAC_DEL_CTY":"GUANAJUATO","MAT_NOM_MA_DELA_CTY":"MARIA CARMEN","MAT_NOM_PA_DELA_CTY":null,"MAT_SEXO_MA_DEL_CTY":"F","MAT_SEXO_PA_DEL_CTY":"M","MUN_COD_NAC_DEL_CTY":"15","actaBisRegMadreElla":null,"actaBisRegPadreElla":null,"fechaNacimientoElla":null,"imaNombreHomologado":null,"municipioCodigoElla":0,"nacionalidadAux1Txt":null,"nacionalidadAux2Txt":null,"nacionalidadEllaTxt":"MEXICANA","nacionalidadMadreEl":0,"nacionalidadPadreEl":0,"ofiCodigoRegMadreEl