"nacionalidadTxt":null,"nombreMadreElla":null,"nombrePadreElla":null,"notasMarginales":"DE ACUERDO CON LA SENTENCIA DE FECHA 16 DE ENERO DE 2024, DICTADA POR LA C. JUEZ DE PARTIDO ESPECIALIZADO EN MATERIA FAMILIAR DE GUANAJUATO, GUANAJUATO, EN EL PROCEDIMIENTO DE DIVORCIO INCAUSADO, EXPEDIENTE NÚMERO F-01171/2023, EL CUAL CAUSÓ EJECUTORIA CON FECHA 18 DE JUNIO DE 2024, PROMOVIDO POR JOSÉ JESÚS PÉREZ ZAMACONA EN CONTRA DE MARTHA VIRIDIANA ZAMORATEGUI MARTÍNEZ, CONFORME A LOS ARTÍCULOS 1° Y 4° DE LA CONSTITUCIÓN POLÍTICA DE LOS ESTADOS UNIDOS MEXICANOS, PARA EL EFECTO DE QUE SE DISUELVA EL VÍNCULO MATRIMONIAL EXISTENTE ENTRE AMBOS, BAJO LOS SIGUIENTES PUNTOS RESOLUTIVOS:\r\n\r\nPRIMERO.- ESTA JUZGADORA FUE COMPETENTE PARA CONOCER Y RESOLVER LA DISOLUCIÓN DEL VÍNCULO MATRIMONIAL. SEGUNDO.- LA VÍA ORAL ORDINARIA BAJO LA QUE SE TRAMITÓ LA RECONVENCIÓN FUE LA CORRECTA.TERCERO.- SE DECLARA LA DISOLUCIÓN DEL VÍNCULO MATRIMONIAL QUE UNE A JOSÉ JESÚS PÉREZ ZAMACONA CON MARTHA VIRIDIANA ZAMORATEGUI MARTÍNEZ, POR LO QUE RECOBRAN AMBOS SU CAPACIDAD PARA CONTRAER NUEVAS NUPCIAS O CONTINUAR SU PROYECTO DE VIDA, SOLOS O CON LA PERSONA QUE DECIDAN. UNA VEZ QUE CAUSE EJECUTORIA LA PRESENTE SENTENCIA Y EN CUMPLIMIENTO A LA CIRCULAR 2/2019-CPJ EXPEDIDA POR LA PRESIDENTE DEL SUPREMO TRIBUNAL DE JUSTICIA DEL ESTADO DE GUANAJUATO DE FECHA 28 VEINTIOCHO DE FEBRERO DE 2019 DOS MIL DIECINUEVE SE ORDENA NOTIFICAR ELECTRÓNICAMENTE A LA OFICIALÍA DONDE SE CELEBRÓ EL MATRIMONIO Y SE DÉ DEBIDO CUMPLIMIENTO A LO ESTABLECIDO EN LOS ARTÍCULOS 117, 118 Y 119 DEL CÓDIGO CIVIL VIGENTE EN EL ESTADO, EN RELACIÓN CON EL DIVERSO 345 DEL MISMO ORDENAMIENTO LEGAL INVOCADO. LAS PRESTACIONES RECLAMADAS EN LA DEMANDA PRINCIPAL COMO EL RESTO DE LAS EXIGIDAS EN LA DEMANDA RECONVENCIONAL SE RESOLVERÁN EN SENTENCIA DIVERSA EN EL MOMENTO PROCESAL OPORTUNO. CUARTO.- NO SE HACE ESPECIAL CONDENA EN COSTAS PROCESALES RESPECTO AL DIVORCIO. QUINTO.- NOTIFÍQUESE EN FORMA PERSONAL A LAS PARTES EN TÉRMINOS DEL ARTÍCULO 800 DEL CÓDIGO PROCESAL CIVIL. ASÍ LO RESOLVIÓ Y FIRMA LA MAESTRA MARÍA EVA GALVÁN PATLÁN, JUEZA DE PARTIDO CIVIL ESPECIALIZADA EN MATERIA FAMILIAR, QUIEN ACTÚA ASISTIDA POR LA SECRETARIA DE ACUERDOS DEL JUZGADO LICENCIADA MARÍA GUADALUPE DEL PILAR UGALDE MEDINA QUIEN DA FE.\r\n\r\nLO ANTERIOR CON FUNDAMENTO EN EL ARTÍCULO 117 DEL CÓDIGO CIVIL DEL ESTADO. GUANAJUATO, GUANAJUATO A 25 DE JUNIO DE 2024. EL C. OFICIAL DEL REGISTRO CIVIL 01 DE GUANAJUATO, GUANAJUATO. LICENCIADO RAFAEL ALBERTO GARCÍA LOZA. DOY FE. SELLO DE LA OFICIALÍA. FIRMADO.\r\n\r\n","oficialiaNombre":null,"segundoApellido":null,"MAT_EDAD_DEL_CTY":null,"MAT_ERROR_ORIGEN":null,"MAT_NOM_DELA_CTY":"MARTHA VIRIDIANA","MAT_SEXO_DEL_CTY":"M","MAT_TIPO_PERSONA":null,"anioRegMadreElla":0,"anioRegPadreElla":0,"localidadMadreEl":null,"localidadPadreEl":null,"matArchivoOrigen":null,"matDocExtranjero":null,"nacionalidadAux1":0,"nacionalidadAux2":0,"nacionalidadElla":0,"ofiCodigoRegElla":0,"primerApellidoEl":"PEREZ","MAT_EDAD_DELA_CTY":null,"MAT_SEXO_DELA_CTY":"F","actaBisRegMadreEl":null,"actaBisRegPadreEl":null,"actaNumeroRegElla":0,"entidadCodigoElla":0,"fechaModificacion":null,"fechaNacimientoEl":null,"fechaRegistroDate":"20/03/2013","municipioCodigoEl":0,"nacionalidadElTxt":"MEXICANA","segundoApellidoEl":"ZAMACONA","MAT_ARCHIVO_ORIGEN":null,"MAT_DOC_EXTRANJERO":null,"MAT_NOM_MA_DEL_CTY":"JOSEFINA","MAT_NOM_PA_DEL_CTY":null,"entidadCodigoRegEl":0,"estadoRegNacNombre":null,"localidadMadreElla":null,"localidadPadreElla":null,"municipioNacNombre":null,"municipioRegNombre":"GUANAJUATO","primerApellidoElla":"ZAMORATEGUI","ENT_COD_NAC_DEL_CTY":"11","MAT_EDAD_MA_DEL_CTY":null,"MAT_EDAD_PA_DEL_CTY":null,"MAT_LOC_NAC_DEL_CTY":"GUANAJUATO","MAT_NOM_MA_DELA_CTY":"MARTA ELVA","MAT_NOM_PA_DELA_CTY":"GERARDO","MAT_SEXO_MA_DEL_CTY":"F","MAT_SEXO_PA_DEL_CTY":null,"MUN_COD_NAC_DEL_CTY":"15","actaBisRegMadreElla":null,"actaBisRegPadreElla":null,"fechaNacimientoElla":null,"imaNombreHomologado":null,"municipioCodigoElla":0,"nacionalid